import {useState} from "react";
import { Routes, Route, Link,} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import ContactList from "./components/contact-list.js";
import Contact from "./components/contact.js"
// import AddContact from "./components/create-contacts.js";
// import DeleteContact from "./components/delete-contact.js";
// import UpdateContact from "./components/update-contact.js";


function App() {
  const [contact,] = useState(null)

  return (
    <div >
      <nav className="navbar navbar-expand navbar-dark bg-dark">
        <a href="/contacts" className="navbar-brand">
          ContactList
        </a>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/create-contact"} className="nav-link">
              Create Contact
            </Link>
          </li>
          <li className="nav-item">
            <Link to={"/contacts"} className="nav-link">
              Contacts
            </Link>
          </li>
        </div>
      </nav>

      <div>
        <Routes>
          <Route exact path="/contacts" component={ContactList}/>
          <Route 
            path="/contact/:id" 
            render={(props) => (
              <Contact {...props} contact={contact}/>
            )}
          />
          {/* <Route
            path="/update-contact/:id"
            render={(props) => (
              <UpdateContact {...props} contact={contact}/>
            )}
          />
          <Route
            path="/delete-contact/:id"
            render={(props) => (
              <DeleteContact {...props} contact={contact}/>
            )}
          /> */}
        </Routes>
      </div>
    </div>
  );
}

export default App;
